import React, {Component} from 'react'
import {Link,NavLink,Router,Redirect,Switch} from "react-router-dom";


class App extends Component{
    render(){
        return(
            <div className="App">
                <h3>app</h3>
                <Link to="/home">首页</Link>


                <Route/>
            </div>
        )
    }
}
export default App
